import React from 'react';
import Header from './Header'
import UploadImage from './UploadImg';
import AnswerBoxes from './AnswerBoxes';
import GenerateFeedback from './GenFeedback';

const App: React.FC = () => {
  return (
    <div className="App">
      <Header />
      <UploadImage />
      <AnswerBoxes />
      <GenerateFeedback />
    </div>
  );
};

export default App;
